import React, { useState, useEffect } from "react";
import { useTranslation } from "react-i18next";
import { useParams } from "react-router-dom";
import Header from "../header-footer/header";
import Footer from "../header-footer/footer";
import "./manage-crops.css";

export default function CropList() {
  const { userId } = useParams();
  const { t } = useTranslation();
  const [crops, setCrops] = useState([]);

  useEffect(() => {
    fetch(`http://localhost:5001/api/commerce/getallcrops/${userId}`)
      .then((response) => response.json())
      .then((data) => setCrops(data))
      .catch((error) => console.error(error));
  }, [userId]);

  const handleSell = async (cropId) => {
    try {
      const response = await fetch(
        `http://localhost:5001/api/commerce/updateCrop/${cropId}`,
        {
          method: "PUT",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            status: "sold",
            sell: true,
          }),
        }
      );

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      console.log(data.message);
      setCrops(crops.map((crop) => (crop._id === cropId ? data.crop : crop)));
    } catch (error) {
      console.error("There was a problem with the fetch operation:", error);
    }
  };

  return (
    <div className="crops-main">
      <Header />
      <div className="manage-crops">
        <table>
          <thead>
            <tr>
              <th>{t("table.name")}</th>
              <th>{t("table.variety")}</th>
              <th>{t("table.category")}</th>
              <th>{t("table.label")}</th>
              <th>{t("table.harvestDate")}</th>
              <th>{t("table.quantity")}</th>
              <th>{t("table.unit")}</th>
              <th>{t("table.pricePerUnit")}</th>
              <th>{t("table.actions")}</th>
            </tr>
          </thead>
          <tbody>
            {crops.map((crop) => (
              <tr key={crop._id}>
                <td>{crop.name}</td>
                <td>{crop.variety}</td>
                <td>{crop.category}</td>
                <td>{crop.label}</td>
                <td>{new Date(crop.harvestDate).toLocaleDateString()}</td>
                <td>{crop.quantity}</td>
                <td>{crop.unit}</td>
                <td>{crop.pricePerUnit}</td>
                <td>
                  {crop.status === "sold" ? (
                    crop.quantity > 0 ? (
                      <button disabled className="on-sale">
                        {t("table.onSale")}
                      </button>
                    ) : (
                      <button disabled className="sold">
                        {t("table.sold")}
                      </button>
                    )
                  ) : crop.quantity > 0 ? (
                    <button
                      onClick={() => handleSell(crop._id)}
                      className="on-sale"
                    >
                      {t("table.onSale")}
                    </button>
                  ) : (
                    <button disabled className="out-of-stock">
                      {t("table.outOfStock")}
                    </button>
                  )}
                  <button className="update">{t("table.update")}</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <Footer />
    </div>
  );
}
